      <span>13</span>
      <span>08</span>
      <span>12</span>
      <span>05</span>
      </section>
      <section className='duration'>
      <span>DAYS asas</span>
      <span>HOURS</span>
      <span>MINS</span>
      <span>SECS</span>


      </section>
      <p className='para'>UNTIL DROP</p>
    </section>

  );
};

export default Countdown;
